INSERT INTO `news_nws` VALUES (20,'Procedura timesheet Admin Gateway','<p>Buna,</p>\r\n<p>Timesheet-ul trebuie completat, iar perioada inchisa in ultima zi lucratoare a lunii.</p>\r\n<p>La sfarsitul fiecarei luni, ultima pagina sau ultimele doua (important este sa se vada caseta cu numarul de zile lucratoare, nume consultant, nume manager) a raportului de activitate, trebuie printata, semnata de angajat si de manager, scanata si atasata in aplicatie.</p>\r\n<p><img src=\"/projects_management/tiny_images/Capture1.PNG\" alt=\"\" /></p>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Capture2.PNG\" alt=\"\" /></p>\r\n<p><img src=\"/projects_management/tiny_images/capture3.png\" alt=\"\" /></p>\r\n<p>Multumesc,</p>\r\n<p>Roxana</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','a:11:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";}',0,8,'2014-04-16 10:25:58'),(21,'Sarbatori legale si zile de Weekend','<p>Buna ziua,</p>\r\n<p>&nbsp;</p>\r\n<p>Pentru a nu avea nelamuriri cu privire la modul de completare al Timesheet-ului in ceea ce priveste zilele libere (&nbsp;Sarbatori legale si zile de Weekend) se vor introduce ore in aplicatie doar daca s-a lucrat in zilele respective. Altfel trebuie lasate <strong>NECOMPLETATE.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n<p>Multumesc,</p>\r\n<p>&nbsp;</p>','a:12:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";}',0,139,'2014-06-30 11:12:19'),(22,'test','<p>mesaj de test</p>','a:1:{i:0;s:1:\"5\";}',0,118,'2014-11-05 10:16:48'),(23,'My MedCare - Propriul tau asistent medical!','<p><strong>Acum poti avea propriul tau asistent medical!</strong></p>\r\n<p><strong>Descarca gratuit aplicatia My MedCare!</strong></p>\r\n<p>&nbsp;&nbsp;<img src=\"/projects_management/tiny_images/Untitled1.png\" alt=\"\" width=\"123\" height=\"129\" /><img src=\"/projects_management/tiny_images/Untitled2.png\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>My MedCare</strong> este aplicatia smartphone&nbsp; creata de <strong>BRD Asigurari de Viata</strong> special pentru a-ti oferi o legatura directa cu asigurarea ta de sanatate &ndash; <strong>BRD MedCare.</strong>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Descarca acum aplicatia My MedCare pentru a beneficia de :</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>&nbsp; Acces rapid la servciul de urgenta 112;</li>\r\n<li>&nbsp; Acces direct la serviciul de call center BRD MedCare line</li>\r\n<li>&nbsp; Asistenta pentru orice informatii legate de programari in cadrul retelei de sanatate &nbsp;MedLife, informatii despre nivelul de acoperire al asigurarii sau de plata despagubirilor</li>\r\n<li>&nbsp; Consiliere medicala 24/7 in cazul in care aveti nevoie imediata de sfaturi si recomandari pentru imbunatatirea starii de sanatate.O echipa dedicata de medici va sta la dispozitie;</li>\r\n<li>&nbsp; Geolocalizarea centrelor medicale MedLife pentru a putea identifica unitatea medicala cea mai apropiata de locatia ta;</li>\r\n<li>&nbsp; Organizarea eficienta a activitatilor zilnice referitoare la sanatate prin intermediul &nbsp;functiilor aplicatiei, create special pentru acoperirea tuturor nevoilor:\r\n<ul>\r\n<li>Contacte</li>\r\n<li>Agenda medicala</li>\r\n<li>Alerte medicale</li>\r\n</ul>\r\n</li>\r\n<li>&nbsp; Contact rapid prin e-mail cu consilierii BRD Asigurari de Viata</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Cum pot descaraca aplicatia My MedCare ?</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Scaneaza codul QR code</strong> cu telefonul mobil si urmeaza instructiunile</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;sau</p>\r\n<p><strong>Descarca direct </strong>din</p>\r\n<ul>\r\n<li>&nbsp; App store</li>\r\n<li>&nbsp; Google play</li>\r\n<li>&nbsp; Windows phone store &ndash; disponibila in curand</li>\r\n</ul>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Poza3.jpg\" alt=\"\" /></p>\r\n<p>Aplicatia My MedCare este disponibila pe smartphone si tableta pentru sistemul Android, Iphone si Windows.</p>\r\n<p>&nbsp;</p>\r\n<p>Pentru mai multe informatii te invitam sa accesezi <a href=\"http://www.brdasigurarideviata.ro\">www.brdasigurarideviata.ro</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Now you can have your own personal health assistant!</strong></p>\r\n<p><strong>Download for free My MedCare application!</strong></p>\r\n<p><img src=\"/projects_management/tiny_images/Untitled1.png\" alt=\"\" width=\"123\" height=\"129\" /><img src=\"/projects_management/tiny_images/Untitled2.png\" alt=\"\" /></p>\r\n<p><strong>My MedCare</strong> is the mobile application developped by <strong>BRD Asigurari de Viata</strong> especially for you in order to have direct acces to your health insurance &ndash; <strong>BRD MedCare.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Download now My MedCare application and you can benefit of :</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>&nbsp; Faster acces to emergency call 112</li>\r\n<li>&nbsp; Direct acces to BRD MedCare line&nbsp; for:</li>\r\n<li>&nbsp; Support &amp; guidance for any questions related to the medical appointments within MedLife network, level of coverage, or claim payment;</li>\r\n<li>&nbsp; Direct medical advice 24/7 in case you may need medical support on the spot or medical&nbsp;recomandation for health recovery provided by a team of doctors;</li>\r\n<li>&nbsp; Geolocalization of MedLife medical centers in order to find the closest one from your position</li>\r\n<li>&nbsp; Easy management of daily healthcare activity through functions of the application created for your needs:\r\n<ul>\r\n<li>My medical contacts</li>\r\n<li>My medical agenda</li>\r\n<li>My pills alerts&nbsp;</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>&nbsp; Fast contact by e-mail with your BRD Asigurari de Viata&nbsp; counselor</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>How can I download My MedCare application?</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Scan the QR code</strong> from this message with your phone and follow the indication</p>\r\n<p>or</p>\r\n<p><strong>Download</strong> directly from</p>\r\n<ul>\r\n<li>&nbsp; App store</li>\r\n<li>&nbsp; Google play</li>\r\n<li>&nbsp; Windows phone store &ndash; coming soon</li>\r\n</ul>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Poza3.jpg\" alt=\"\" /></p>\r\n<p>My MedCare is available on Smartphone and tablets for Android, Iphone and Windows devices.</p>\r\n<p>&nbsp;</p>\r\n<p>For&nbsp; more information please visit <a href=\"http://www.brdasigurarideviata.ro\"><strong>www.brdasigurarideviata.ro</strong></a></p>','a:13:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";i:12;s:2:\"12\";}',1,118,'2015-04-02 11:46:56'),(24,'Numar unic de asistenta servicii medicale','<p>In atentia colegilor care detin o asigurare privata de sanatate:</p>\r\n<p>-&nbsp;<strong>Serviciile de ambulator</strong> incluse in asigurare pot fi accesate conform conditiilor prezentate pentru fiecare pachet numai <strong>in cadrul</strong> <strong>CLINICILOR</strong> MedLife si nu <strong>in cadrul SPITALELOR</strong> MedLife&nbsp;(in spitale se fac contra cost)</p>\r\n<p>- Orice serviciu neinclus in pachetul de asigurare beneficiaza de un discount de 20%</p>\r\n<p>- <strong>Schema de functionare</strong> a numarului unic de asistenta servicii medicale:</p>\r\n<p><img src=\"/projects_management/tiny_images/CC1.png\" alt=\"\" width=\"618\" height=\"500\" /></p>\r\n<p><img src=\"/projects_management/tiny_images/CC2.png\" alt=\"\" width=\"614\" height=\"453\" /></p>\r\n<p><img src=\"/projects_management/tiny_images/CC3.png\" alt=\"\" width=\"620\" height=\"459\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','a:13:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";i:12;s:2:\"12\";}',1,118,'2015-04-02 11:47:14'),(25,'Procedura Concediu Medical (pentru angajati cu CIM)','<p><strong>In atentia colegilor angajati cu CIM:</strong></p>\r\n<p>- in situatia in care nu este posibila prezenta la lucru vei informa din prima zi PM-ul&nbsp;(daca lucrezi pe proiecte interne Vauban) sau PM-ul si managerul de la client (daca lucrezi pe proiecte la client) si Departamentul Administrativ Vauban (<a href=\"mailto:cristina.curta@vauban.ro\">cristina.curta@vauban.ro</a> si&nbsp;<a href=\"mailto:corina.pop@vauban.ro\">corina.pop@vauban.ro</a>). Departamentul Administrativ va informa Directorul General despre orice neprezentare la serviciu si va monitoriza cazurile in care lipsesc colegi care lucreaza singuri pe proiecte la client si nu au back-up.&nbsp;</p>\r\n<p>- daca&nbsp;nu te-ai putut prezenta la lucru din <strong>motive medicale</strong>&nbsp;personale sau ale copilului in varsta de pana la 7 ani (pentru mame) vei inregistra in cel mai scurt timp concediul medical in Admin Gateway urmand ca&nbsp;in maximum 3 zile sa atasezi si certificatul medical la respectiva inregistrare. Exceptie: atunci cand concediul medical intra in vigoare dupa ce ai comunicat in avans prezenta la serviciu pana la sfarsitul lunii, vei atasa certificatul medical imediat ce l-ai obtinut si vei informa&nbsp;Departamentul Administrativ Vauban pentru reglarea salariului si a bonurilor de masa.</p>\r\n<p>- certificatul medical <strong>in original</strong> trebuie sa ajunga la Departamentul Administrativ Vauban <strong>cel tarziu pana in data de 3 a lunii urmatoare celei in care a fost emis&nbsp;</strong></p>\r\n<p><span style=\"color: #ff0000;\">Atentie! Zilele nelucrate dar nejustificate prin inregistrarea unui concediu medical in Admin Gateway si predarea certificatului medical in original vor fi considerate CFP (concediu fara plata) si inregistrate in REVISAL.</span></p>\r\n<p><strong>Inregistrarea concediului medical in Admin Gateway</strong> se face in meniul Holidays &amp; Other Leaves, submeniul Medical Leaves:</p>\r\n<p>- dai click&nbsp;pe New request si se deschide fereastra in care vei completa toate campurile marcate cu <span style=\"color: #ff0000;\">*<span style=\"color: #000000;\">, dupa care dai click pe Send Request</span></span></p>\r\n<p><img src=\"/projects_management/tiny_images/Ecran_new_medical_request.JPG\" alt=\"\" width=\"718\" height=\"263\" />&nbsp;</p>\r\n<p>- pentru a emite declaratia de concediu medical dai click pe numele fisierului (2014_12_09_Medical_Leave in exemplu de mai jos), apoi salvezi fisierul generat, il tiparesti si semnezi:</p>\r\n<p><img src=\"/projects_management/tiny_images/Ecran_atasare_CM.jpg\" alt=\"\" width=\"631\" height=\"31\" /></p>\r\n<p>- pentru a atasa declaratia de concediu medical si certificatul medical dai click&nbsp;pe agrafa (le poti incarca pe amandoua dar nu deodata, ci fisier cu fisier):</p>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Ecran_atasare_CM.jpg\" alt=\"\" width=\"631\" height=\"31\" /></p>\r\n<p>-&nbsp;se deschide fereastra de incarcare a fisierului, dai click pe Choose File, selectezi fisierul din locatia in care l-ai salvat, dai click pe Atach si apoi pe Close:</p>\r\n<p><img src=\"/projects_management/tiny_images/Ecran_atasare_CM2.jpg\" alt=\"\" width=\"764\" height=\"190\" /></p>\r\n<p>&nbsp;</p>','a:12:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";}',1,118,'2015-03-27 13:51:30'),(26,'Calendar 2015 - finalizare operatiuni in Admin Gateway (pentru angajati cu CIM)','<p><strong>In atentia colegilor angajati cu CIM:&nbsp;</strong></p>\r\n<p>- in vederea calcularii salariului cuvenit lunar, raportarea orelor lucrate si a activitatilor efectuate se va finaliza in Admin Gateway conform calendarului de mai jos:</p>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Calendar_2015_operatiuni_in_AG.jpg\" alt=\"\" /></p>\r\n<p>TBD=to be decided</p>\r\n<p>Cazuri exceptionale: daca dupa inchiderea RAL aveti nevoie sa faceti modificari in datele raportate puteti solicita redeschiderea RAL prin email la <a href=\"mailto:admingtw@vauban.ro\">admingtw@vauban.ro</a></p>','a:13:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";i:12;s:2:\"12\";}',1,118,'2015-04-02 11:47:01'),(27,'Procedura Concediu Platit/Neplatit','<p><strong>In atentia tuturor angajatilor si colaboratorilor Vauban:</strong></p>\r\n<p>- concediul platit/neplatit se solicita prin Admin Gateway cu un avans de cateva zile,&nbsp;necesar pentru aprobarea acestuia. Daca lucrezi la client, inainte sa inregistrezi solicitarea de concediu este necesar sa ai acordul managerului de la client</p>\r\n<p>- solicitarea de concediu platit/neplatit poate fi aprobata in termen de 2 zile de catre aprobatorul selectat, dupa care va fi escaladata la Managerul&nbsp;Administrativ (<a href=\"mailto:cristina.curta@vauban.ro\">cristina.curta@vauban.ro</a>)&nbsp;pentru aprobare</p>\r\n<p><span style=\"color: #ff0000;\">Pentru angajatii cu CIM: Zilele nelucrate dar nejustificate printr-o solicitare de concediu platit/special event in Admin Gateway vor fi considerate CFP (concediu fara plata)&nbsp;si inregistrate in REVISAL.</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Angajatii cu CIM isi pot consulta numarul de zile de concediu platit in modulul General Informations:</strong></p>\r\n<p><strong><img src=\"/projects_management/tiny_images/Zile_CO_legal.JPG\" alt=\"\" /></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Inregistrarea cererii de acordare a concediului platit in Admin Gateway</strong>&nbsp;se face in meniul Holidays &amp; Other Leaves, submeniul Paid Vacations:</p>\r\n<p>- dai click&nbsp;pe New request: selectezi Full Day(s) sau Fractionated day(s), completezi perioada, selectezi aprobatorul dupa care dai click pe Send Request. Daca selectezi Fractionated day(s) vei lua concediu o jumatate din norma zilnica de lucru, de ex. cei incadrati cu norma 8 ore/zi vor lua 4 ore de concediu. Orice fractie mai mica de jumatate dintr-o zi de concediu va fi reportata de la un an la altul si reglata cu ocazia lichidarii.</p>\r\n<p><img src=\"/projects_management/tiny_images/Paid_vacation.JPG\" alt=\"\" /></p>\r\n<p>- solicitarea va ramane in status Pending pana la aprobare/rejectare</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Anularea cererii de acordare a concediului platit in Admin Gateway&nbsp;</strong>se face in meniul Holidays Approval, submeniul Paid Vacations:</p>\r\n<p>- solicitarea poate fi anulata atat timp cat este in status Pending; daca este in status Approved, o poti anula numai pana inainte de inceperea concediului. Anularea se face cu click pe&nbsp;<img src=\"/projects_management/tiny_images/Capture.JPG\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Aprobarea/rejectarea cererii de acordare a concediului platit in Admin Gateway</strong>&nbsp;se face in meniul Holidays Approval, submeniul Holidays Approval:</p>\r\n<p>- solicitarea in status Pending este afisata timp de 2 zile la aprobatorul selectat de catre initiatorul cererii, timp alocat pentru aprobare/rejectare. Dupa acest termen solicitarea va disparea si va fi afisata la&nbsp;Managerul&nbsp;Administrativ pentru aprobare/rejectare</p>\r\n<p><img src=\"/projects_management/tiny_images/Ecran_aprobare_concediu.JPG\" alt=\"\" width=\"872\" height=\"103\" /></p>\r\n<p>- inainte de a aproba solicitarea dai click pe simbolul \"ochi\" si se deschide submeniul Vacations Summary, in care vei analiza stocul de zile de concediu platit. Vei aproba cererea doar daca stocul este suficient sa acopere zilele de concediu platit solicitate&nbsp;</p>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Ecran_istoric_concedii.JPG\" alt=\"\" width=\"870\" height=\"211\" /></p>\r\n<p>- aprobarea / rejectarea solicitarii se face cu click pe una dintre optiunile de mai jos. Dupa aprobare, solicitarea va fi vizibila in meniul Holidays Approval, submeniul Employees Days Off History:</p>\r\n<p><img src=\"/projects_management/tiny_images/Aprobare_cerere.JPG\" alt=\"\" width=\"63\" height=\"55\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"/projects_management/tiny_images/Ecran_rejectare_cerere.JPG\" alt=\"\" width=\"53\" height=\"55\" /></p>\r\n<p>&nbsp;- numarul zilelor de concediu platit ramase se actualizeaza dupa aprobare</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Inregistrarea cererii de acordare a concediului neplatit in Admin Gateway</strong>&nbsp;se face in meniul Holidays &amp; Other Leaves, submeniul Unpaid Vacations:</p>\r\n<p>- dai click&nbsp;pe New request: selectezi Full Day(s) sau Fractionated day(s), completezi perioada, motivul, selectezi aprobatorul dupa care dai click pe Send Request. Daca selectezi&nbsp;Fractionated day(s) vei lua concediu o jumatate din norma zilnica de lucru, de ex. cei incadrati cu norma 8 ore/zi vor lua 4 ore de concediu</p>\r\n<p><img src=\"/projects_management/tiny_images/Upaid_vacation.JPG\" alt=\"\" width=\"601\" height=\"434\" /></p>\r\n<p>- solicitarea va ramane in status Pending pana la aprobare/rejectare</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Anularea cererii de acordare a concediului neplatit in Admin Gateway&nbsp;</strong>se face in mod similar cu anularea cererii de concediu platit.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Aprobarea/rejectarea cererii de acordare a concediului neplatit in Admin Gateway</strong>&nbsp;se face in mod similar cu aprobarea cererii de concediu platit.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Inregistrarea cererii de acordare zile libere platite (cu ocazia unui eveniment din lista de mai jos) in Admin Gateway</strong>&nbsp;se face in meniul Holidays &amp; Other Leaves, submeniul Special Events:</p>\r\n<p>- dai click&nbsp;pe New request si se deschide fereastra in care vei completa toate campurile marcate cu&nbsp;*, dupa care dai click pe Send Request</p>\r\n<p><img src=\"/projects_management/tiny_images/Ecran_new_special_event.JPG\" alt=\"\" width=\"739\" height=\"295\" /></p>\r\n<p><strong>Lista de evenimente pentru care beneficiezi de zile libere platite:</strong></p>\r\n<p><img src=\"/projects_management/tiny_images/Ecran_lista_evenimente.jpg\" alt=\"\" width=\"743\" height=\"145\" /></p>\r\n<p>- evenimentul se va justifica cu documente specifice in cel mai scurt timp dupa intoarcerea la birou, cel tarziu pana in ultima zi lucratoare</p>','a:13:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";i:12;s:2:\"12\";}',1,118,'2015-04-09 10:36:23'),(28,'Raportarea activitatii si emiterea Raportului de Activitate Lunar','<p><strong>In atentia tuturor angajatilor si colaboratorilor:</strong></p>\r\n<p>Iti poti consulta lista de proiecte in meniul <strong>Timesheet/My Timesheet</strong>, tab-ul<strong> My Projects</strong>. Lista este completata cu numele PM-ului intern Vauban si, pentru anumite proiecte, este necesar sa completezi numele managerului de la client:</p>\r\n<p><img src=\"/projects_management/tiny_images/Nume_manager_client-cap_tabel.jpg\" alt=\"\" width=\"926\" height=\"84\" /></p>\r\n<p>&nbsp;- dai click pe <img src=\"/projects_management/tiny_images/Iconita_+.JPG\" alt=\"\" />din campul <strong>Client Manager</strong> si se deschide fereastra de mai jos in care completezi numele managerului apoi dai click pe Save. Daca ulterior vrei sa il modifici, dai click pe&nbsp;<img src=\"/projects_management/tiny_images/Iconita_creion.JPG\" alt=\"\" />, modifici numele si apoi dai click pe Save. Numele managerului de la client completat de tine se va prelua automat in&nbsp;raportul tau de activitate lunar.</p>\r\n<p><img src=\"/projects_management/tiny_images/Nume_manager_client.jpg\" alt=\"\" /></p>\r\n<p><span style=\"color: #ff0000;\">Raportarea activitatii in Admin Gateway se face zilnic, completand orele lucrate pe proiect(e) si activitatile efectuate. Sunt definite doua perioade de raportare distincte: 1-15 si 16-31. RAL se poate emite numai dupa inchiderea celor doua perioade de raportare.</span></p>\r\n<p>Zilnic introduci orele lucrate pentru fiecare proiect si o scurta descriere a activitatilor efectuate. Vei raporta orele lucrate in zilele libere (sarbatori legale si weekend) numai daca ai lucrat in zilele respective, altfel acestea trebuie lasate&nbsp;<strong>NECOMPLETATE.</strong></p>\r\n<p>Ca sa treci de la prima perioada de raportare la a doua dai <strong>Close period,</strong> dupa care ti se va deschide o noua perioada de raportare. Butonul <strong>Close period</strong>&nbsp;devine activ i<strong>n ultima ta zi lucratoare </strong>din perioada de raportare. Aplicatia calculeaza aceasta zi tinand cont de calendarul zilelor lucratoare/nelucratoare din luna si de faptul ca ti s-a aprobat concediu platit/neplatit/liber pentru evenimentele speciale sau ai introdus un concediu medical.</p>\r\n<p><strong>In ultima ta zi lucratoare</strong> <strong>din luna</strong> dai click pe sageata din stanga si te intorci la ultima perioada de raportare inchisa, dupa care:</p>\r\n<p>- selectezi din lista proiectelor All daca lucrezi numai pentru Vauban si in sediul Vauban, sau selectezi un singur proiect daca lucrezi pentru Client sau la sediul Clientului. Daca ai raportat ore in mai multe proiecte o sa repeti pasii pentru fiecare proiect</p>\r\n<p>- selectezi aprobatorul (PM-ul intern Vauban sau&nbsp;Managerul de la client) apoi dai click pe Generate Report si ti se va afisa pe ecran RAL in format PDF</p>\r\n<p><img src=\"/projects_management/tiny_images/Selectare_proiect_si_aprobator.jpg\" alt=\"\" width=\"828\" height=\"113\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\">Atentie! Aplicatia lucreaza cu formate de RAL diferite, formatul fiind atribuit la nivel de proiect. Raportul tau se va genera in formatul corect numai daca ai respectat regulile de selectare a proiectului/proiectelor.</span></p>\r\n<p>- salvezi RAL-ul cu denumirea data de aplicatie apoi il semnezi tu si aprobatorul mentionat pe raport. Daca ai generat mai multe RAL-uri o sa repeti pasii pentru fiecare</p>\r\n<p><img src=\"/projects_management/tiny_images/Semnaturi_pe_RAL.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;- pentru a incarca RAL-ul semnat in aplicatie intri&nbsp;in <strong>Timesheet Attachments</strong>, dai click pe agrafa, dai click pe Choose File, selectezi raportul semnat, dai click pe Attach si apoi inchizi fereastra. Ca sa nu ai probleme la incarcare asigura-te ca acesta respecta restrictiile mentionate. Daca ai generat si semnat mai multe RAL-uri o sa le incarci si pe celelalte in acelasi mod</p>\r\n<p><img src=\"/projects_management/tiny_images/Atasare_RAL.jpg\" alt=\"\" />&nbsp; &nbsp; &nbsp; &nbsp;<img src=\"/projects_management/tiny_images/Restrictii_incarcare_RAL.JPG\" alt=\"\" /></p>\r\n<p>Orice raport incarcat nu mai poate fi sters ci doar suprascris, daca ii pastrezi denumirea initiala. Dupa reincarea RAL corectat este nevoie sa golesti memoria cache a browserului ca sa vezi noul fisier atasat.</p>\r\n<p><span style=\"color: #ff0000;\">Atentie! Este interzisa incarcarea unui raport in alt format decat cel generat de aplicatie, fara o derogare in acest sens de la PM Admin Gateway.</span></p>\r\n<p>&nbsp;</p>','a:13:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";i:12;s:2:\"12\";}',1,118,'2015-04-02 11:47:21'),(29,'Adrese de email importante','<p><strong>Te rugam sa retii urmatoarele adrese de email:</strong></p>\r\n<p>- pentru a recomanda un programator/analist care poate aduce plus valoare echipei Vauban: <a href=\"mailto:hr@vauban.ro\">hr@vauban.ro</a></p>\r\n<p>- pentru suport IT (ex. deblocarea contului de AD/email cu care te loghezi in aplicatia&nbsp;Admin Gateway): <a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a></p>\r\n<p>- pentru suport in utilizarea Admin Gateway, redeschiderea perioadei de raportare, activarea perioadei de raportare: <a href=\"mailto:admingtw@vauban.ro\">admingtw@vauban.ro</a></p>\r\n<p>- pentru nereportarea sau&nbsp;reportarea eronata a zilelor de concediu ramase din anul anterior: <a href=\"mailto:cristina.curta@vauban.ro\">cristina.curta@vauban.ro</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','a:13:{i:0;s:1:\"0\";i:1;s:1:\"1\";i:2;s:1:\"2\";i:3;s:1:\"3\";i:4;s:1:\"4\";i:5;s:1:\"5\";i:6;s:1:\"6\";i:7;s:1:\"7\";i:8;s:1:\"8\";i:9;s:1:\"9\";i:10;s:2:\"10\";i:11;s:2:\"11\";i:12;s:2:\"12\";}',1,118,'2015-04-02 11:47:05'),(30,'User Guide - Access Rights for New Employees','<p>&nbsp;<span style=\"font-size: 10pt;\"><strong>This user Guide describes&nbsp;</strong><strong>the following functionalities of General Manager role</strong><strong>:</strong></span></p>\r\n<p>&nbsp;- &nbsp;Add access/equipment request for new employees</p>\r\n<p>&nbsp;- &nbsp;Check the status of access/equipment requests&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10pt;\"><strong>1. &nbsp; Add access/equipment request for New Employee:</strong></span></p>\r\n<p>Only David Coyne with General Manager role in Admin Gateway has the right to add access/equipment request for new employees. This request is auto-approved.</p>\r\n<p>Go to <strong>Access Rights/Access Rights Dashboard</strong> and click&nbsp;on <strong>New Request</strong>:</p>\r\n<p><img src=\"/projects_management/tiny_images/Meniu_New_Request.JPG\" alt=\"\" /></p>\r\n<p>In the window below perform the steps in the numerical order:</p>\r\n<p><img src=\"/projects_management/tiny_images/Fereastra_New_Request-GM-.jpg\" alt=\"\" width=\"811\" height=\"208\" /></p>\r\n<p>1) fill the First Name and the Last Name according to the ID of the new employee and the personal email where VSDC will send the credentials for Vauban email</p>\r\n<p><strong>Note:</strong> <strong>It&rsquo;s important to fill the name correctly because VSDC will create the email address based on this request.&nbsp;</strong></p>\r\n<p>2) Select the start working date from the calendar</p>\r\n<p>3) Select the Direct Manager who will be responsible to add new access/equipment requests and to review/revoke existing rights for this employee:</p>\r\n<p>o &nbsp;&nbsp;Eliza Popa for employees working in Otetelesanu/Craiova and employees with external assignments&nbsp;</p>\r\n<p>o &nbsp; Laurent Talvasson for employees working in Pitesti</p>\r\n<p>4) Click on Use template and choose the template depending on the new employee\'s assignment External or Internal<span style=\"background-color: #ffffff;\">&nbsp;</span></p>\r\n<p><img src=\"/projects_management/tiny_images/Templates.jpg\" alt=\"\" width=\"818\" height=\"353\" /></p>\r\n<p>Click on the link<span style=\"color: #0000ff;\"><em><strong> use template </strong></em><span style=\"color: #000000;\">next to the template you choose and the rights&nbsp;</span></span>will be populated like is displayed below:</p>\r\n<p><img src=\"/projects_management/tiny_images/External.JPG\" alt=\"\" width=\"754\" height=\"69\" /></p>\r\n<p><img src=\"/projects_management/tiny_images/Internal.JPG\" alt=\"\" width=\"756\" height=\"156\" /></p>\r\n<p>If you don\'t agree with one of them click on <img src=\"/projects_management/tiny_images/Cancel_button.jpg\" alt=\"\" />&nbsp;to delete it. If you want to add another access/equipment select the Category, select the Resource then click on&nbsp;<img src=\"/projects_management/tiny_images/Add_button.JPG\" alt=\"\" />.</p>\r\n<p>When selecting Fileserver from Category list (<strong>only for employees with Internal assignment</strong>):</p>\r\n<p>- click on&nbsp;<img src=\"/projects_management/tiny_images/Dots_button.JPG\" alt=\"\" />&nbsp;to open the list</p>\r\n<p>- choose the folder/subfolder by clicking on the name of it (you can expand the list and choose up to the 3rd level of subfolders)</p>\r\n<p>- select the type of right: Read Only or Read/Write and then click on <img src=\"/projects_management/tiny_images/Add_button.JPG\" alt=\"\" /></p>\r\n<p>3) When you agree click on <img src=\"/projects_management/tiny_images/Save_button.JPG\" alt=\"\" />&nbsp;to auto-approve the request</p>\r\n<p>&nbsp;</p>\r\n<p>The application will send an email to <a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a>&nbsp;and a ticket will be open in Service Desk. The request will be implemented by VSDC then the ticket will be closed in Service Desk and marked as Solved in Admin Gateway.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(0, 0, 0); font-size: 10pt;\"><strong>2. &nbsp; Check the&nbsp;status of access/equipment requests:</strong></span></p>\r\n<p>To see the status of requests added by you go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>My Requests.&nbsp;</strong>Select Request Status <strong>All</strong>.</p>\r\n<p><img src=\"/projects_management/tiny_images/My_Access_Rights-GM.JPG\" alt=\"\" width=\"754\" height=\"93\" /></p>\r\n<p>&nbsp;To see the content of a request click on&nbsp;<img src=\"/projects_management/tiny_images/Eye_butoon.JPG\" alt=\"\" />:</p>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Request_details-GM.JPG\" alt=\"\" width=\"756\" height=\"298\" /></p>\r\n<p>&nbsp;</p>\r\n<p>To see the status of requests added by all users (David, Laurent and Eliza) go to<strong>&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;</strong>and click&nbsp;on<strong>&nbsp;<strong>My Team Requests. </strong></strong>Select <strong>All Employees</strong> and Request Status <strong>All</strong>.</p>\r\n<p><strong><img src=\"/projects_management/tiny_images/My_team_requests.JPG\" alt=\"\" width=\"765\" height=\"170\" /></strong></p>\r\n<p><strong>Legend of Request Status:</strong></p>\r\n<p>Assigned = request assigned by SysAdmin Manager to a SysAdmin user</p>\r\n<p>Canceled = request canceled by the issuer</p>\r\n<p>Pending (approval) = request not yet approved</p>\r\n<p>Pending (assignation) = request not yet assigned by SysAdmin Manager to a&nbsp;SysAdmin user</p>\r\n<p>Rejected = &nbsp;request rejected by the approver</p>\r\n<p>Solved = the only request status where the access/equipment is visible in employees active rights (<strong>My Team Access Rights/<strong>My Access Rights </strong></strong>modules and <strong>Existing Access Rights </strong>view)</p>','a:3:{i:0;s:1:\"5\";i:1;s:1:\"6\";i:2;s:1:\"8\";}',1,118,'2015-03-26 12:32:30'),(31,'User Guide for existing employees, Access Rights Module','<p><span style=\"color: #000000;\"><strong>User Guide for </strong><strong>adding an access/equipment request. To be used only&nbsp;<strong>by e</strong><strong>xisting employees.</strong></strong>&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>- the existing employees can add a request for equipment and other access then on Fileserver.&nbsp;Their request is pending approval of <span style=\"color: #0000ff;\">*</span>.</p>\r\n<p>- the request for access on Fileserver can be added only by <span style=\"color: #0000ff;\">*<span style=\"color: #000000;\">, based on an email sent by the requester.</span></span></p>\r\n<p><span style=\"color: #0000ff;\">*&nbsp;Laurent Talvasson or his delegate</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Preamble:</strong></span></p>\r\n<p>Any request approved in Admin Gateway application has been sent by email to<span class=\"apple-converted-space\">&nbsp;</span><a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a>&nbsp;in order to be handled by VSDC team.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Add access/equipment request:</strong></span></p>\r\n<p>Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>New Request</strong>:</p>\r\n<p><img src=\"/projects_management/tiny_images/New_request_-_SysAdmins.JPG\" alt=\"\" width=\"215\" height=\"66\" /></p>\r\n<p>&nbsp;In the window below perform the steps as described:</p>\r\n<p><img src=\"/projects_management/tiny_images/Create_My_Request.JPG\" alt=\"\" width=\"786\" height=\"146\" /></p>\r\n<p>1) fill a short&nbsp;Reason</p>\r\n<p>2) select one Category, select the Resource wanted then click Add. If&nbsp;you cannot find what you are looking for contact either the VSDC Manager or the PM of Admin Gateway.</p>\r\n<p>Repeat this step for each access/equipment request &nbsp;</p>\r\n<p>3) click Save&nbsp;to send this request for approval</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Check&nbsp;the requests created by you or for you and their&nbsp;status:&nbsp;</strong></span></p>\r\n<p>Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>My Requests.&nbsp;</strong>Select Request Status&nbsp;<strong>All</strong>.</p>\r\n<p><img src=\"/projects_management/tiny_images/My_requests.JPG\" alt=\"\" width=\"792\" height=\"100\" /></p>\r\n<p>To see the content of a request click on <img src=\"/projects_management/tiny_images/Eye_butoon.JPG\" alt=\"\" />:</p>\r\n<p><img src=\"/projects_management/tiny_images/Request_details.JPG\" alt=\"\" width=\"803\" height=\"157\" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Legend of Request Status:</strong></p>\r\n<p>Assigned = request assigned by SysAdmin Manager to a SysAdmin user</p>\r\n<p>Canceled = request canceled by the issuer</p>\r\n<p>Pending (approval) = request not yet approved</p>\r\n<p>Pending (assignation) = request not yet assigned by SysAdmin Manager to a&nbsp;SysAdmin user</p>\r\n<p>Rejected = request rejected by the approver</p>\r\n<p>Solved = the only request status with the access/equipment visible in<span class=\"apple-converted-space\">&nbsp;</span><strong>My Access Rights</strong><span class=\"apple-converted-space\"><strong>&nbsp;</strong></span>module and in<span class=\"apple-converted-space\"><strong>&nbsp;</strong></span><strong>Existing Access Rights</strong><span class=\"apple-converted-space\"><strong>&nbsp;</strong></span>view</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>See the access/equipment requests made by you or for you having the status solved:</strong></span></p>\r\n<p><span style=\"color: #000000;\">1) Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>My Access Rights:</strong></span></p>\r\n<p><img src=\"/projects_management/tiny_images/My_Access_Rights.JPG\" alt=\"\" width=\"794\" height=\"97\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;2) Your existing rights appears also on the <strong>New Request</strong> window:</p>\r\n<p><span style=\"color: #000000;\"><img src=\"/projects_management/tiny_images/New_request-see_existing_request.JPG\" alt=\"\" width=\"798\" height=\"208\" /></span></p>','a:1:{i:0;s:1:\"5\";}',0,118,'2015-03-26 12:20:43'),(32,'User Guide for SysAdmins, Access Rights Module','<p><strong>User Guide for</strong><strong>&nbsp;</strong><strong>SysAdmins describing the functionalities:</strong></p>\r\n<p>- handle access requests unassigned by SysAdmin Manager</p>\r\n<p><strong>-</strong> handle access requests assigned by SysAdmin Manager or self-assigned</p>\r\n<p>- see the access requests solved by the logged user</p>\r\n<p>See <strong>User Guide for Existing Employees </strong>before adding an access/equipment for you personally.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Preamble:</strong></span></p>\r\n<p>Any request approved in Admin Gateway application has been sent by email to<span class=\"apple-converted-space\">&nbsp;</span><a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a>&nbsp;in order to be handled by VSDC team.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Handle access requests unassigned by SysAdmin Manager:</strong></span></p>\r\n<p>Go to <strong>Access Rights/<strong>Requests Resolution</strong></strong>&nbsp;and click on <strong>Unassigned </strong>tab:</p>\r\n<p><img src=\"/projects_management/tiny_images/Unassigned.JPG\" alt=\"\" width=\"768\" height=\"114\" /></p>\r\n<p>To see the access request details click on&nbsp;<img src=\"/projects_management/tiny_images/Eye_butoon.JPG\" alt=\"\" />:</p>\r\n<p><img src=\"/projects_management/tiny_images/Request_pending_assignation.JPG\" alt=\"\" width=\"771\" height=\"247\" /></p>\r\n<p>Close the window and select your name in the field <strong>Assign to</strong>:</p>\r\n<p><img src=\"/projects_management/tiny_images/Assign_to_myself_a_request_unassigned.jpg\" alt=\"\" width=\"771\" height=\"42\" /></p>\r\n<p>&nbsp;The request will disappear from <strong>Unassigned</strong> tab and will appear in <strong>Assigned</strong> <strong>to Me</strong> tab.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Handle access requests assigned by SysAdmin Manager or self-assigned:</strong></span></p>\r\n<p>Go to <strong>Access Rights/<strong>Requests Resolution</strong></strong>&nbsp;and click on <strong>Assigned to Me </strong>tab:</p>\r\n<p><img src=\"/projects_management/tiny_images/Assigned_to_me_request.JPG\" alt=\"\" width=\"772\" height=\"91\" /></p>\r\n<p>To see the access request details click on&nbsp;<img src=\"/projects_management/tiny_images/Eye_butoon.JPG\" alt=\"\" />. Note that the access requests made for new employees contain the personal email where VSDC shall send the credentials of Vauban email.</p>\r\n<p><img src=\"/projects_management/tiny_images/Assigned_to_me_request-new_employee.JPG\" alt=\"\" width=\"775\" height=\"366\" /></p>\r\n<p>To print the access request click on&nbsp;<img src=\"/projects_management/tiny_images/Print_button.JPG\" alt=\"\" />.</p>\r\n<p>The request shall be solved by VSDC then the ticket will be closed in Service Desk and marked as Solved in Admin Gateway.&nbsp;</p>\r\n<p>To solve the request click on&nbsp;<img src=\"/projects_management/tiny_images/Mark_as_solved.JPG\" alt=\"\" />.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>See the acces requests solved by the logged user:</strong></span></p>\r\n<p>Go to <strong>Access Rights/ Requests Resolution</strong> and click on <strong>Solved </strong>tab:</p>\r\n<p><img src=\"/projects_management/tiny_images/My_Solved_requests.JPG\" alt=\"\" width=\"761\" height=\"88\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Legend for request status:</strong></span></p>\r\n<p>Assigned = request assigned by SysAdmin Manager to a SysAdmin user</p>\r\n<p>Pending (assignation) = request not yet assigned by SysAdmin Manager to a&nbsp;SysAdmin user</p>\r\n<p>Solved = the only request status with the access/equipment visible in&nbsp;<strong>My Access Rights</strong>&nbsp;module and in&nbsp;<strong>Existing Access Rights</strong>&nbsp;view</p>','a:4:{i:0;s:1:\"4\";i:1;s:1:\"5\";i:2;s:1:\"6\";i:3;s:1:\"8\";}',1,118,'2015-03-23 22:01:10'),(33,'User Guide for SysAdmin Manager, Access Rights Module','<p><strong>User Guide for</strong><strong>&nbsp;</strong><strong>SysAdmin Manager describing the functionalities:</strong></p>\r\n<p><strong>-</strong> add Access Request on Fileserver</p>\r\n<p>- review/revoke the access/equipment granted to each employee</p>\r\n<p>See <strong>User Guide for Existing Employees&nbsp;</strong>before adding an access/equipment for you personally.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Preamble:</strong></span></p>\r\n<p>Any request approved in Admin Gateway application has been sent by email to<span class=\"apple-converted-space\">&nbsp;</span><a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a>&nbsp;in order to be handled by VSDC team.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Add access request on Fileserver for Existing Employee:</strong></span></p>\r\n<p>You should add access requests on Fileserver only for existing employees with Internal assignment (request pending approval of Direct Manager).</p>\r\n<p>In order to better control the requests of access on Fileserver, the person having SysAdmin Manager role has also been assigned as employees&rsquo; Direct Manager, with the exception of David Coyne having the General Manager role.</p>\r\n<p>Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>New Request</strong>:</p>\r\n<p><img src=\"/projects_management/tiny_images/Meniu_New_Request.JPG\" alt=\"\" /></p>\r\n<p>Perform the steps as described below:</p>\r\n<p><img src=\"/projects_management/tiny_images/Request_for_existing_employee-SAM.JPG\" alt=\"\" width=\"760\" height=\"148\" /></p>\r\n<p>- Fill the field Reason shortly</p>\r\n<p>- Select the employee in the field Request For: pick list with all active employees</p>\r\n<p>- Select the approver in the field Approve By: pick list with 2 options:</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>Employees&rsquo; Direct Manager</li>\r\n<li>David Coyne</li>\r\n</ul>\r\n<p>The request will be pending approval of the person selected as approver.</p>\r\n<p>- Select Category: Fileserver then click on&nbsp;<img src=\"/projects_management/tiny_images/Dots_button.JPG\" alt=\"\" />&nbsp;to open the list</p>\r\n<p>- Choose the folder/subfolder by clicking on the name of it (you can expand the list and choose up to the 3rd level of subfolders)</p>\r\n<p>- Select the type of right: Read Only or Read/Write and then click on&nbsp;<img src=\"/projects_management/tiny_images/Add_button.JPG\" alt=\"\" /></p>\r\n<p>- If you selected a wrong item click on&nbsp;<img src=\"/projects_management/tiny_images/Delete_button.jpg\" alt=\"\" />&nbsp;to delete it</p>\r\n<p>- To add more than one access on Fileserver repeat the steps 4-6</p>\r\n<p>- When you finish click on&nbsp;<img src=\"/projects_management/tiny_images/Save_button.JPG\" alt=\"\" />&nbsp;to submit the request</p>\r\n<p>The application will send an email to the approver to enter the application and approve or reject the request. The request can be canceled before it&rsquo;s approved.</p>\r\n<p>When the request is approved the application will send an email to&nbsp;<a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a>&nbsp;and a ticket will be openin Service Desk. The request will be implemented by VSDC then the ticket will be closed in Service Desk and marked as Solved in Admin Gateway.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Approve/reject an access/equipment request:</strong></span></p>\r\n<p>Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>My Team Requests.&nbsp;</strong>Select Active Employees All and Request Status&nbsp;<strong>All</strong>.</p>\r\n<p><img src=\"/projects_management/tiny_images/My_team_requests-SAM.JPG\" alt=\"\" width=\"759\" height=\"209\" /></p>\r\n<p>To see the content of a request click on&nbsp;<img src=\"/projects_management/tiny_images/Eye_butoon.JPG\" alt=\"\" />. If you are the approver click on one option Approve/Reject:</p>\r\n<p><img src=\"/projects_management/tiny_images/Request_app_or_rej_details.jpg\" alt=\"\" width=\"762\" height=\"211\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Review the access/equipment granted to each employee:</strong></span></p>\r\n<p>Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>My Team Access Rights</strong>:</p>\r\n<p>Click on&nbsp;<img src=\"/projects_management/tiny_images/Plus_button.JPG\" alt=\"\" />&nbsp;to expand the list of access/equipment for an employee. Beware that only requests marked as Solved by VSDC are displayed here:</p>\r\n<p><img src=\"/projects_management/tiny_images/Accese_angajati.jpg\" alt=\"\" width=\"772\" height=\"121\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Revoke the access/equipment granted to an employee:</strong></span></p>\r\n<p>Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>New Request</strong>:</p>\r\n<p>Fill in a short Reason, select the employee in the field Request For and select the approver. Then click on the right(s) you want to revoke from the list of existing access rights. For access on Fileserver you can either revoke or change a right. To change a right click on it then select the other option in the field Access Mode.&nbsp;</p>\r\n<p><img src=\"/projects_management/tiny_images/Revocare_drepturi_bun-SAM.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Legend of Request Status:</strong></span></p>\r\n<p>Assigned = request assigned by SysAdmin Manager to a SysAdmin user</p>\r\n<p>Canceled = request canceled by the issuer</p>\r\n<p>Pending (approval) = request not yet approved</p>\r\n<p>Pending (assignation) = request not yet assigned by SysAdmin Manager to a&nbsp;SysAdmin user</p>\r\n<p>Rejected = request rejected by the approver</p>\r\n<p>Solved = the only request status with the access/equipment visible in&nbsp;<strong>My Team Access Rights/My Access Rights</strong>&nbsp;modules and in&nbsp;<strong>Existing Access Rights</strong>&nbsp;view</p>','a:4:{i:0;s:1:\"4\";i:1;s:1:\"5\";i:2;s:1:\"6\";i:3;s:1:\"8\";}',1,118,'2015-03-23 22:00:54'),(34,'User Guide for Administrative Manager, Access Rights Module','<p><strong>User Guide for</strong><strong>&nbsp;Administrative Manager describing the following functionalities</strong><strong>:</strong></p>\r\n<p>- check and validate the new employees added automatically to Employees table</p>\r\n<p>- make corrections and add the rest of the information to Employees table</p>\r\n<p>See <strong>User Guide for Existing Employees </strong>before adding an access/equipment for you personally.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Preamble:</strong></span></p>\r\n<p>Any access/equipment request approved in Admin Gateway application has been sent by email to&nbsp;<a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a> in order to be handled by VSDC team.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Check and validate the new employees added automatically to Employees table:</strong></span></p>\r\n<p>Only David Coyne with General Manager role in Admin Gateway has the right to add access/equipment request for new employees (request auto-approved).</p>\r\n<p>Any access/equipment request created by General Manager for a new employee will automatically add the employee to Employees table.</p>\r\n<p>Go to <strong>Employees </strong>and click twice on <strong>Start Date </strong>column in the table header to sort the list in descending order. On top of the list you will see the employees added automatically, for which you should check and validate the existing information.</p>\r\n<p><img src=\"/projects_management/tiny_images/Employees_table.JPG\" alt=\"\" width=\"755\" height=\"285\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Make corrections and add the rest of the information to Employees table:</strong></span></p>\r\n<p>To see the existing information added automatically for a new employee click on the employee name:</p>\r\n<p><img src=\"/projects_management/tiny_images/Employee_Ion_Vasilescu.JPG\" alt=\"\" width=\"754\" height=\"240\" /></p>\r\n<p>You shall correct the existing information and add the rest of the mandatory information in the fields marked with then click Save.</p>\r\n<p>If you need assistance to correct/add information to Employees table see the document&nbsp;<strong>AdminGateway_Administrative Manager User Guide.pdf</strong></p>','a:4:{i:0;s:1:\"3\";i:1;s:1:\"5\";i:2;s:1:\"6\";i:3;s:2:\"12\";}',1,118,'2015-04-02 11:47:33'),(35,'User Guide - Access Rights for Existing Employees','<p><strong>This User Guide describes the following functionalities:</strong></p>\r\n<p>- Add access/equipment request for existing employees</p>\r\n<p>- Review/revoke the access/equipment granted to employees&nbsp;</p>\r\n<p>- Check the status of access/equipment requests</p>\r\n<p><span style=\"font-size: 10pt;\"><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>Who can a</strong><strong>dd </strong><strong>an </strong><strong>access/equipment requests</strong><strong>:</strong>&nbsp;</span></p>\r\n<p>Existing employees will send their access/equipment request by email/phone to the following persons:</p>\r\n<p>o &nbsp; Employees working in Otetelesanu/Craiova and employees with external assignments to Eliza Popa</p>\r\n<p>o &nbsp; Employees working in Pitesti&nbsp;to Laurent Talvasson</p>\r\n<p>The request will be added in Admin Gateway and will be pending approval of David Coyne.</p>\r\n<p>By default, David Coyne can add a request for any employee - this request will be&nbsp;auto-approved.</p>\r\n<p><strong>Note: only approved requests will be forwarded to <a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a> for implementation.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"font-size: 10pt;\"><strong>2. &nbsp; &nbsp; &nbsp;How to add an access/equipment request:</strong></span>&nbsp;</strong></p>\r\n<p>Go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>New Request:</strong></p>\r\n<p><strong><img src=\"/projects_management/tiny_images/Meniu_New_Request.JPG\" alt=\"\" width=\"463\" height=\"81\" /></strong></p>\r\n<p>User David Coyne will see this window:</p>\r\n<p><img src=\"/projects_management/tiny_images/Request_for_existing_employee-GM.JPG\" alt=\"\" width=\"814\" height=\"155\" /></p>\r\n<p>Users Laurent Talvasson and Eliza Popa will see this window:</p>\r\n<p><img src=\"/projects_management/tiny_images/Fereastra_New_Request.JPG\" alt=\"\" width=\"876\" height=\"187\" /></p>\r\n<p>Perform the steps as described below:</p>\r\n<p>1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If not user David Coyne fill the field <strong>Reason</strong> shortly</p>\r\n<p>2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Select the employee in the field <strong>Request For</strong>: pick list with all active employees (user David) or pick list with assigned employees (users Laurent and Eliza)</p>\r\n<p>3)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If not user David Coyne click in the field <strong>Approval By </strong>and select David Coyne</p>\r\n<p>4)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Select <strong>Category:</strong></p>\r\n<p><strong><img src=\"/projects_management/tiny_images/Category.jpg\" alt=\"\" width=\"134\" height=\"108\" /></strong></p>\r\n<p>5)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; For <strong>Category</strong> &ldquo;User Access&rdquo;, Equipment &amp; Furniture&rdquo;, &ldquo;Software&rdquo; and &ldquo;Application Code&rdquo; select the <strong>Resource</strong> (specific pick list) then click on Add button</p>\r\n<p>6)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; For <strong>Category</strong> Fileserver (only for employees with Internal assignment) click on&nbsp;<img src=\"/projects_management/tiny_images/Dots_button.JPG\" alt=\"\" width=\"15\" height=\"16\" /> &nbsp;to open the list and:</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Choose the folder/subfolder by clicking on the name of it (you can expand the list and choose up to the 3rd level of subfolders)</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Select the type of right: Read Only or Read/Write and then click on Add button</p>\r\n<p>7)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To delete a wrong added item click on&nbsp;<img src=\"/projects_management/tiny_images/Delete_button.jpg\" alt=\"\" width=\"17\" height=\"14\" /></p>\r\n<p>8)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To add more than one access/equipment repeat the steps 4-6</p>\r\n<p>9)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you finish click on Save button to submit the request</p>\r\n<p>For requests pending approval: the application will send an email to David to enter the application and approve or reject the request.&nbsp;The request can be canceled only before it&rsquo;s approved.</p>\r\n<p>For requests auto-approved by David: the application&nbsp;will send an email to <a href=\"mailto:support_vsdc@vauban.ro\">support_vsdc@vauban.ro</a>&nbsp;for implementation.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10pt;\"><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>Who can r</strong><strong>eview/revoke the access/equipment </strong><strong>rights</strong><strong>:</strong></span></p>\r\n<p>Periodically all access/equipment rights will be reviewed thus:</p>\r\n<p>o For employees working in Otetelesanu/Craiova and employees with external assignments: by Eliza Popa</p>\r\n<p>o For employees working in Pitesti: by Laurent Talvasson</p>\r\n<p>In case of employee leaving the company or employee change of responsibility a revoke request will be added in Admin Gateway by Eliza or Laurent and will be pending approval of David Coyne.&nbsp;</p>\r\n<p>By default, David Coyne can add a revoke request for any employee - this request will be&nbsp;auto-approved.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10pt;\"><strong>4. &nbsp; &nbsp; &nbsp;How to review/r</strong><strong>evoke the access/equipment&nbsp;</strong><strong>rights of&nbsp;</strong><strong>assigned e</strong><strong>mployee</strong><strong>s</strong><strong>:</strong><br /></span></p>\r\n<p>Users Laurent and Eliza can review/revoke only the rights of assigned employees. User David can review/revoke the rights of any employee.</p>\r\n<p>To review all active rights go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>My Team Access Rights:</strong></p>\r\n<p><strong><img src=\"/projects_management/tiny_images/Meniu_New_Request.JPG\" alt=\"\" width=\"469\" height=\"82\" /></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Click on&nbsp;<img src=\"/projects_management/tiny_images/Plus_button.JPG\" alt=\"\" width=\"16\" height=\"18\" /> &nbsp;to expand the list of access/equipment for an employee. Beware that only requests marked as Solved by VSDC are displayed here:</p>\r\n<p><img src=\"/projects_management/tiny_images/Accese_angajati.jpg\" alt=\"\" width=\"817\" height=\"128\" /></p>\r\n<p>To revoke all or just some rights of the employeee go to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>New Request. </strong>Fill in a short reason, select the employee in the field <strong>Request For </strong>and,&nbsp;if user Laurent/Eliza, select&nbsp;the approver<strong>&nbsp;David Coyne.</strong></p>\r\n<p>For employees leaving the company you should revoke all rights by a click on the box before &ldquo;Revoke Access?&rdquo;. For other employees click on the box near the right(s) you want to revoke:</p>\r\n<p>&nbsp;<img src=\"/projects_management/tiny_images/Revocare_drepturi.JPG\" alt=\"\" width=\"838\" height=\"198\" /></p>\r\n<p>Access rights on Fileserver can be revoked or can be changed from Read/Write to Read Only or vice versa. To do this click on it then select the other option in the field Access Mode:</p>\r\n<p><img src=\"/projects_management/tiny_images/Change_rights_on_Fileserver.jpg\" alt=\"\" width=\"789\" height=\"93\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10pt;\"><strong>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>Check the&nbsp;status of access/equipment requests:</strong></span></p>\r\n<p>If loged user is David: to see the status of the requests added by any user go to&nbsp;<strong>Access Rights/Access Rights Dashboard&nbsp;</strong>and click&nbsp;on<strong>&nbsp;My Team Requests.</strong>&nbsp;Select&nbsp;<strong>All Employees</strong>&nbsp;and Request Status&nbsp;<strong>All</strong>.</p>\r\n<p>If loged user is Laurent or Eliza: to see the status of the requests added by you go&nbsp;to&nbsp;<strong>Access Rights/Access Rights Dashboard</strong>&nbsp;and click&nbsp;on&nbsp;<strong>My Requests,</strong> then select Request Status&nbsp;<strong>All</strong>.</p>\r\n<p>To see the content of a request click on &nbsp;<img src=\"/projects_management/tiny_images/Eye_butoon.JPG\" alt=\"\" width=\"20\" height=\"15\" />.</p>\r\n<h1><span style=\"font-size: 10pt;\"><strong>Legend of Request Status:</strong></span></h1>\r\n<p>Assigned = request assigned by SysAdmin Manager to a SysAdmin user</p>\r\n<p>Canceled = request canceled by the issuer</p>\r\n<p>Pending (approval) = request not yet approved</p>\r\n<p>Pending (assignation) = request not yet assigned by SysAdmin Manager to a&nbsp;SysAdmin user</p>\r\n<p>Rejected = request rejected by the approver</p>\r\n<p>Solved = the only request status where the access/equipment is visible in employees active rights (<strong>My Team Access Rights/My Access Rights</strong>&nbsp;modules and&nbsp;<strong>Existing Access Rights</strong>&nbsp;view)</p>','a:3:{i:0;s:1:\"5\";i:1;s:1:\"6\";i:2;s:1:\"8\";}',1,118,'2015-03-26 12:19:39');
