 design si proiectare\r\n-COD BARE(control om, operatie, sector, masina)\r\n-definire exacta a nomeclatorului\r\n-training persoana Electrotel for CEGID ERP\r\n-CONTROL ANGAJATI\r\n-PONTAJ\r\n-CONTROL ACCES',0,1),(18436,198,21,NULL,'2014-12-08',NULL,NULL,NULL,8.00,'Bug testing \r\nRezolvat probleme cu editarea profilului',0,1),(18437,198,21,NULL,'2014-12-09',NULL,NULL,NULL,8.00,'Bug Testing\r\nImplementat Reset Password',0,1),(18438,204,80,NULL,'2014-12-08',NULL,NULL,NULL,8.00,NULL,0,1),(18439,204,80,NULL,'2014-12-09',NULL,NULL,NULL,8.00,NULL,0,1),(18440,137,10,NULL,'2014-12-09',NULL,NULL,NULL,9.00,'deplacement  Alexandria \r\n\r\ndemonstration PMI pour electrotel',0,1),(18441,137,75,NULL,'2014-12-08',NULL,NULL,NULL,1.00,NULL,0,1),(18442,137,10,NULL,'2014-12-08',NULL,NULL,NULL,8.50,NULL,0,1),(18443,137,10,NULL,'2014-12-05',NULL,NULL,NULL,8.00,NULL,0,1),(18444,137,10,NULL,'2014-12-04',NULL,NULL,NULL,9.00,NULL,0,1),(18445,137,10,NULL,'2014-12-03',NULL,NULL,NULL,7.00,NULL,0,1),(18446,137,75,NULL,'2014-12-03',NULL,NULL,NULL,3.00,NULL,0,1),(18447,137,10,NULL,'2014-12-02',NULL,NULL,NULL,8.00,NULL,0,1),(18448,208,95,NULL,'2014-12-08',NULL,NULL,NULL,8.00,NULL,0,1),(18449,208,95,NULL,'2014-12-09',NULL,NULL,NULL,8.00,NULL,0,1),(18450,208,95,NULL,'2014-12-10',NULL,NULL,NULL,8.00,NULL,0,1),(18451,144,55,NULL,'2014-12-08',NULL,NULL,NULL,6.00,NULL,0,1),(18452,197,89,NULL,'2014-12-10',NULL,NULL,NULL,8.00,NULL,0,1),(18453,149,62,NULL,'2014-12-10',NULL,NULL,NULL,8.00,'IT&Support SGEBS',0,1),(18454,209,43,NULL,'2014-12-10',NULL,NULL,NULL,3.50,'-personal meeting regarding ASF preliminary meeting planning\r\n(after they solve the issue with rca romanian problem by end of the year they will make a fast reorganizataion and we can enter)',0,1),(18455,199,90,NULL,'2014-12-10',NULL,NULL,NULL,8.00,'14:00 - 22:00',0,1),(18456,172,52,NULL,'2014-12-09',NULL,NULL,NULL,8.00,'Am facut teste',0,1),(18457,150,18,NULL,'2014-12-10',NULL,NULL,NULL,4.00,NULL,0,1),(18458,150,10,NULL,'2014-12-10',NULL,NUL